import React from "react";
import "./AnimeSection.css";

const AnimeSection = () => {
  return (
    <section id="anime" className="section anime">
      <h2>Anime</h2>
      <p>Les meilleurs animes du moment !</p>
    </section>
  );
};

export default AnimeSection;
